import React from 'react';



class CardBody extends React.Component {
    render() {
        return (
            <div className="card-body">
                <h3 className="text-white">Equilibrium #3429</h3>
                <p >Our Equilibrium collement promotes  balance and calme</p>
            </div>
        )
    }
}

export default CardBody;
